import React from "react";

const DisplayBlog = (props) => {
    return (
        <div className="BlogContainer">
            <div>Toolbar</div>
            <div>Name = {props.name}</div>
            <div>City = {props.city} </div>
            <div>BlogContent</div>
        </div>
    )
}

export default DisplayBlog;
